(17, 412, 'Maidana', 'Julio', 24005622, '1968-03-16', 1, 'Maestria en Salud Publica, con orientación a practicas preventivas. Facultad de Odontologia. Res N°643/12-C.S', '•	Autor de Calidad en los Accesos Vasculares. Presentado en la 46º Jornadas Medico- Bioquímicas del Interior. 10º Jornadas de Kinesiología del Interior.\r\n•	Autor de Experiencia de calidad en un Centro Quirúrgico  Presentado en la 46 Jornadas Medico - Bioquímicas del Interior. 10º Jornadas de Kinesiología del Interior.\r\n•	Autor de Aplicación de ISO 9002 en al Mejora de los Standares de Anemia en Diálisis  Presentado en la 46º Jornadas Medico - Bioquímicas del Interior. 10º Jornadas de Kinesiología del Interior.\r\n	Autor Improvement Autocomes with ISO 9002 Norm in Peritoneal Dialisis. En el Congreso Internacional de Diálisis Peritoneal . Montreal Canadá \r\n	Autor ISO 9002 En Health, Efficiency in Supply of Critical Inputs. Presentado en el Congreso Internacional de Calidad Bs. As 2 al 5 de Octubre de 2000.\r\n	Roll of The Internal Audits of Tha Quality in Dialysis like base to Make Efficient the Costs-Benefits. Presentado en Congreso Internacional de Calidad. Bs. As 2 al 5 de Octubre de 2000.\r\n	Continuous Improvement In Nursing Management under Standards ISO 9002.  Presentado en el congreso internacional de Calidad. París Francia 5 al 8 de Noviembre de 2002.\r\n	Cost Of Non- Quality In The Choice of Vascular Accesses for Patients with CRF. Presentado en el Congreso Internacional de Calidad. París Francia 5 al 8 de Noviembre de 2002.\r\n	Nuestra experiencia en la evaluación de proveedores de servicios.  IIJORNADAS NACIONAL DE LA SOCIEDAD ARGENTINA PARA LA CALIDAD EN ATENCION DE LA SALUD. Bs As 19 de septiembre 2003.', NULL, NULL, NULL, NULL, '379-4320737', 'jumcer@yahoo.com.ar', NULL, '379-4430113', NULL, NULL, 18, NULL, 18, '2016-05-09 21:25:25', '2016-07-22 15:20:19', '579263e32ed64.jpg', '2016-07-22 15:20:19'),
(18, 429, 'Toledo', 'María José', 30050780, '2016-02-21', 0, NULL, NULL, 'En el IMCiF (Instituto de Medicina y Ciencias Forenses) trabaje en el sector de Calidad, formo parte del equipo que la implemento del Sistema de Gestión de Calidad basado en la Norma ISO 9001:2008, la cual se certifico en septiembre del año 2015. También forme parte del equipo de trabajo para implementar el Modelo de calidad según el Premio Provincial a la calidad del año 2013; la cual el IMCiF fue Ganador del premio para sector Publico.\r\nActualmente trabajo en dependencias del Poder Judicial formando parte del equipo de trabajo de la OGCJ,  implementando procesos de mejora en algunas dependencias judiciales.', 'PPC 2013\r\nPPC 2014\r\nPPC 2015', 'Auditoria Interna desde el año 2011 en el IMCiF del Poder Judicial del Chaco hasta la actualidad, formo parte de equipo auditor que realiza auditorias una vez al año.', 'Participe en Jornadas de Difusión del Sistema de Gestión de la Calidad Implementado en el IMCiF, dentro del Poder Judicial.\r\nParticipe como Invitada para mostrar el SGC basado en el Modelo del premio a la Calidad del año 2013, en la Jornada organizada por Subsecretaria de Coordinación y Gestión Pública en el año 2015\r\nParticipo como capacitadora del Centro de Estudio Judiciales en capacitaciones destinadas a difundir y capacitar sobre los Enfoques de la Calidad.', '3624251847', 'toledomariajose@yahoo.com.ar', NULL, '4452980 Int. 126', 'mariajose.toledo@justiciachaco.gov.ar', NULL, 19, NULL, 19, '2016-05-11 11:48:02', '2016-07-21 10:25:49', '5790cd5d99b0e.jpg', '2016-07-21 10:25:49'),
