(31, 429, 'Desoindre', 'Alejandra Liliana', 23987643, '2016-05-18', 1, 'Doctorado en Educación. Cursado Finalizado - Tesis pendiente', 'Trabajos Publicados:\r\n\r\n	“Práctica Profesional Supervisada en la Carrera de Contador Público de la Facultad de Ciencias Economicas de la Universidad Nacional del Nordeste: Una Propuesta en Construccion” Trabajo presentado y aprobado para publicación en el XXI Congreso Nacional de Profesionales en Ciencias Económicas – Consejo Profesional de Ciencias Económicas de Salta – Organizado por la Federación Argentina de Consejos Profesionales de Ciencias Económicas – Salta, 29, 30 y31 de Octubre de 2014 – Autores: Cra. Ana C. Cristaldo – Cra. Alejandra L. Desoindre – Cra. Griselda L.  Pujol y Cra. Mabel G. Yanda. \r\n\r\n	“El Rol del Docente Tutor y la Evaluación en el Taller integrador Interdisciplinario” - Resumen del trabajo final de carrera de posgrado Especialización en Docencia Universitaria – Autora: Cra. Alejandra Liliana Desoindre. Publicado en Revista de Ciencias Humanas. Estudios y Monografías de los Postgrados de la Facultad de Humanidades de la UNNE. Revista Nro 9 - Sección IV: La Cátedra Universitaria como objeto de análisis: Diversas perspectivas que develan su complejidad. ISSN Nº 1851 – 8990. http://hum.unne.edu.ar/revistas/postgrado/revista9.htm\r\n\r\n	 “Los desafíos del docente tutor: funciones y formación para su desempeño” – Trabajo presentado en el 1er Congreso Argentino de Sistemas de Tutorías – Universidad Nacional de Misiones – Oberá –16 y 17 de Septiembre de  2010 – Autores: Desoindre, Alejandra Liliana – Guasti, Pedro – Pujol, Griselda Lilián – Yanda, Mabel Gladys – Publicado en anales de congreso – ISBN – 978 – 950 – 579 – 168 – 2. http://www.fio.unam.edu.ar/Eventos/CongresoTutorias2010/pdf/resumen_ponencias.pdf\r\n\r\n	 “La acción tutorial en situaciones problemáticas o conflictivas” – Trabajo presentado en el 1er Congreso Argentino de Sistemas de Tutorías – Universidad Nacional de Misiones – Oberá –16 y 17 de Septiembre de  2010 – Autores: Desoindre, Alejandra Liliana – Guasti, Pedro – Lobera Pacin, Néstor Santiago – Pérez Zamparo, Ana Dorys – Pujol, Griselda Lilián – Yanda, Mabel Gladys – Publicado en anales de congreso – ISBN – 978 – 950 – 579 – 168 – 2. http://www.fio.unam.edu.ar/Eventos/CongresoTutorias2010/pdf/resumen_ponencias.pdf\r\n\r\n	“La formación del contador público para el ejercicio profesional en los nuevos escenarios. Problemáticas y desafíos\" – Trabajo presentado y expuesto en el XVIII Congreso Nacional de Profesionales en Ciencias Económicas – Consejo Profesional de Ciencias Económicas de la Ciudad Autónoma de Buenos Aires – Organizado por la Federación Argentina de Consejos Profesionales de Ciencias Económicas – Ciudad Autónoma de Buenos Aires – 16, 17 y 18/06/2010 – Autores: Cra. Ana C. Cristaldo – Cra. Alejandra L. Desoindre – Cra. Mabel G. Yanda. Publicado en “18º Congreso Nacional de Profesionales en Ciencias Económicas: Área VII Política, Educación y Desarrollo Profesional” Editorial Osmar D. Buyatti CABA - Junio de 2010 - ISBN – 978 – 987 – 660 – 067 -5\r\n\r\n	 “El aprendizaje basado en competencias (ABC). Experiencias del Taller Integrador Interdisciplinario. Universidad Nacional del Nordeste - Argentina”- Ponencia aprobada y presentada en el IV Congreso Internacional sobre el Enfoque Basado en Competencias. CIEBC 2008 – Bogotá, Colombia – 17, 18, 19 y 20/06/2008 – Organizado por la Corporación Centro Internacional para el Marketing Territorial para la Educación y el Desarrollo – Autores: Ms. Gabriel E: Ojeda – Cra. Mabel G. Yanda – Cra. Alejandra L. Desoindre – Dra. Ana Dorys Pérez Zamparo. Publicado en http://www.portafolioconsultores.org/memoriasciebc2008/\r\n\r\n	“La formación en competencias en el Taller Integrador Interdisciplinario”- Ponencia presentada y expuesta en las Terceras Jornadas de Comunicación de Experiencias Pedagógicas Innovadoras – Programa de Formación Docente Continua – Secretaria General Académica - U.N.N.E.  – Resistencia – 8 y 9/11/2007 – Autores: Ms. Gabriel E: Ojeda – Cra. Mabel G. Yanda – Cra. Alejandra L. Desoindre – Dra. Ana Dorys Pérez Zamparo – Publicado en http://www.unne.edu.ar/\r\n\r\n	 “El Aprendizaje Basado en Proyectos como estrategia de articulación e integración de contenidos curriculares y de aprendizaje autónomo y cooperativo. Vivencias y experiencias de su aplicación en el Taller Integrador Interdisciplinario”- Ponencia presentada y expuesta en las Segundas Jornadas de Comunicación de Experiencias Pedagógicas Innovadoras – Programa de Formación Docente Continua – Secretaria General Académica - U.N.N.E.  – Resistencia –  11 y 12/08/2005 – Autores: Ms. Gabriel E: Ojeda – Cra. Mabel G. Yanda – Cra. Alejandra L. Desoindre – Cra. Griselda L. Pujol – Cr. Cristian O. Marenco. Publicado en http://www.unne.edu.ar/\r\n\r\n Ponencias presentadas en reuniones científicas\r\n\r\n	“La experiencia de la asignatura Taller Integrador Interdisciplinario como espacio curricular de integración en la formación para la práctica profesional”. Ponencia presentada en las “Quintas Jornadas de Comunicación de Experiencias Pedagógicas Innovadoras”, realizado durante el mes de noviembre de 2013, en el marco del Programa de Formación Docente Continúa de la UNNE. Autores: Cras. Mabel Yanda, Alejandra Desoindre y Griselda Pujol.\r\n\r\n	“La función del docente tutor en el Taller Integrador Interdisciplinario”- Ponencia presentada y expuesta en las Jornadas Iberoamericanas de Tutoría y Orientación en Educación Superior – Organizadas por la Universidad Juan Agustín Maza y Eon Argentina –Mendoza – 9, 10 y 11/09/2009 – Autores: Cra. Alejandra L. Desoindre – Cra. Mabel G. Yanda – Cra. Griselda L. Pujol – Publicado en CD de memorias de las jornadas\r\n\r\n	“La formación del docente tutor en el Taller Integrador Interdisciplinario”- Ponencia presentada en las Jornadas Iberoamericanas de Tutoría y Orientación en Educación Superior – Organizadas por la Universidad Juan Agustín Maza y Eon Argentina –Mendoza – 9, 10 y 11/09/2009 – Autores: Cra. Alejandra L. Desoindre – Cra. Mabel G. Yanda – Cra. Griselda L. Pujol – Publicado en CD de memorias de las jornadas\r\n\r\n	“El sistema tutorial en el Taller Integrador Interdisciplinario”- Ponencia presentada en las Jornadas Iberoamericanas de Tutoría y Orientación en Educación Superior – Organizadas por la Universidad Juan Agustín Maza y Eon Argentina –Mendoza – 9, 10 y 11/09/2009 – Autores: Ms. Gabriel E: Ojeda – Cra. Mabel G. Yanda – Cra. Alejandra L. Desoindre – Publicado en CD de memorias de las jornadas\r\n\r\n	“Las tutorías en el Taller Integrador Interdisciplinario. La necesidad de formación del docente tutor”- Ponencia presentada y expuesta en el II Seminario Internacional “Los Sistemas Tutoriales en la Universidad” – Universidad de Buenos Aires – Facultad de Ciencias Económicas – Subsecretaría Pedagógica – Buenos Aires – 8, 9 y 10/10/2003 - Autores: Ms. Gabriel E: Ojeda – Cra. Silvia A. Díaz – Cra. Alejandra L. Desoindre – Cra. Mabel G. Yanda \r\n\r\n	 “La evaluación del sistema tutorial como parte del proceso de evaluación de los objetivos de aprendizaje de los alumnos”. Trabajo presentado en el II Seminario Internacional “Los Sistemas Tutoriales en la Universidad” – Universidad de Buenos Aires – Facultad de Ciencias Económicas – Subsecretaría Pedagógica – Buenos Aires – 8, 9 y 10/10/2003 - Autores: Ms. Gabriel E: Ojeda – Cra. Silvia A. Díaz – Cra. Alejandra L. Desoindre – Cra. Mabel G. Yanda \r\n\r\n	 “Entre los cambios y las innovaciones…”.  Ponencia presentada en co-autoría con los Cres. Luciano Martinez y Lorena Ortiz para el XII Seminario “Los Jóvenes Profesionales en Ciencias Económicas y su capacitación para la dirigencia”. Consejo Profesional de la Ciudad Autónoma de Buenos Aires. Septiembre, 2003.-', NULL, NULL, NULL, NULL, '0362-154600382', 'aledesoindre@hotmail.com', NULL, '0362-4452951', 'atp.aldesoindre@chaco.gov.ar', NULL, 32, NULL, 1, '2016-05-18 11:26:56', '2016-06-29 11:00:23'