(45, 1523, 'BAEZ', 'MARIELA PATRICIA ALEJANDRA', 23385028, '1973-05-16', 1, 'Profesor Universitario', NULL, NULL, NULL, NULL, 'No poseeo expediencia  con relación la gestión de calidad, sin embargo mi tesis de la licenciatura ha sido el diseño de una política pública de mejorar de la calidad de los servicios de recolección de basura en la Provincia de Misiones.\r\nParte de éste trabajo, fué expuesto en el CONIE 2015 organizado por el IPAP de Chaco, experiencia muy enriquecedora.\r\nConsidero importante participar en esta evaluación porque me interesa tomar el curso de evaluador y porque estoy convencida que es importante y necesaria la gestión de calidad en la Administración Pública, ámbito en el que me desenvuelvo diariamente, a fin de poder replicar o proponer ésta innovadora propuesta enmi provincia. Además es interesante el intercambio de experiencias con otros profeionales.', '3764-282330', 'abyaari@yahoo.com', NULL, '03764-444157', 'diradultosmisiones@gmail.com', NULL, 46, NULL, 1, '2016-05-23 09:43:27', '2016-07-21 10:45:22', '5790d1f273f9e.jpg', '2016-07-21 10:45:22'),
