(47, 920, 'MEDRANO', 'MARINA NOELIA', 29395839, '1982-04-20', 0, NULL, 'EL PROCESO DE ADMINISTRACIOND EL INSTITUTO DE TURISMO DELCHACO - EXPERICINCIAS DE IMPLEMENTACION DE MEJORAS E INNOVACION - 1ER CONGRESO NACIONAL DE INNOVACION EN EL ESTADO - NOV 2015', 'El Instituto de Turismo del Chaco realizó la Implementación del sistema de gestión en base al Premio Nacional a la Calidad para el Sector Público desde el año 2012, con mención especial en el año 2014 y ganadores del Premio Nacional a la Calidad para el Sector Público 2015.\r\n\r\nEl Instituto también implementó Buenas Prácticas para el sector Turistico y fue implementador de DIrectrices de calidad en distintos ámbitos.', NULL, 'INSTITUTO DE TURISMO DEL CHACO - Auditor interno en base al Premio Nacional a la Calidad para el sector público', 'Desde el año 2012 participé como implementadora del Premio Nacional a la Calidad para el sector público y en el año 2013 contribuí en el proceso de definición y prueba del Premio Provincial a la Calidad de la provincia del Chaco. A su vez, desde la institución  en la que desempeñé el cargo de Directora se fomentó la participación como evaluadores de nuestro personal, y en todos los casos mi participación fue activa desde el acompañamiento, no pudiendo participar de los cursos de evaluadores pero si acompañando el proceso del personal a mi cargo.', '011-1568852913', 'mnmedrano@yahoo.com', NULL, '011-1568852913', 'mnmedrano@yahoo.com', NULL, 48, NULL, 48, '2016-05-23 14:07:09', '2016-07-21 10:39:31', '5790d09320a51.JPG', '2016-07-21 10:39:31'),
(48, 423, 'DELLERA', 'CHRISTIAN', 24259172, '1974-12-20', 1, 'Curso de Medicina Forense.Universidad Nacional del Nordeste. Cohorte 2015-2016', '•	“Utility of the Glasgow 7 Surveillance Program and its capability to predict outcome. Experience of CUCAI Chaco .INCUCAI” -2011 Organ Donation Congress.  11º Congress of the International Society of Organ Donation and Procurement. 2º Congress of the Iberoamerican Society of Transplant Coordinators. Buenos Aires, 27 de noviembre de 2011\r\n•	“Importance of the Emergency Room in the Procurement System -CUCAI Chaco`s experience “-2011 Organ Donation Congress.  11º Congress of the International Society of Organ Donation and Procurement. 2º Congress of the Iberoamerican Society of Transplant Coordinators. Buenos Aires, 27 de noviembre de 2011\r\n•	“The importance of early treatment with tranexamic acid in bleeding trauma patients: an exploratory analysis of the CRASH-2 randomized controlled trial”. Publicado on line en  www.thelancet.com March 24, 2011 DOI:10.1016/S0140-6736(11)60278-X \r\n•	“Impacto de las Infecciones del Sistema Nervioso Central en el Sistema de Procuración Argentino”. Congreso Internacional del Infectología Pediátrica y Vacunas. Buenos Aires. 27 y 28 de marzo de 2014\r\n•	FIBRILACIÓN AURICULAR Y TIEMPO DE EVOLUCIÓN ASOCIADOS A MEJORES RESULTADOS EN LA TROMBOLISIS EN EL ACV AGUDO”. XXIII Jornadas Nacionales de los Distritos Regionales.  XIX Jornadas Interdistritales de Técnicos en Cardiología. XX Jornadas Interdistritales de Enfermería en Cardiología. II Jornadas Multidisciplinarias de los Distritos en Enfermedad de Chagas. SOCIEDAD ARGENTINA DE CARDIOLOGÍA.17 y 18 de mayo de 2012\r\n•	Certificado de Compleción de Capacitación de la Buena Práctica Clínica proporcionado por London School of Hygiene & Tropical Medicine ( 10 Julio 2012)\r\n•	Investigador Principal  Estudio CRASH 2  (Clinical Randomisation of an Antifibrinolytic in Significant Haemorrhage 2)- Auspiciado por London School of Hygiene & Tropical Medicine(University of London)-ISRCTN86750102, Clinicaltrials.gov NCT00375258-Resultados publicados en Lancet 2010;376(9734):23‐32.\r\n•	Investigador Principal Estudio IMPRESS (International Multicentre PREvalence Study on Sepsis) auspiciado por la European Society of Intensive Care Medicine(ESICM) y la Society of Critical Care Medicine. Año 2013.Resultados aún no publicados\r\n•	Investigador Principal Estudio IC GLOSSARI (The Intensive Care GLObal Study on Severe Acute Respiratory Infection) auspiciado por la European Society of Intensive Care Medicine (ESICM). NCT01936207 -Año 2013.Resultados aún no publicados\r\n•	Investigador Principal TAVEM PROJECT (International Multicenter Study of Ventilator Associated. Tracheobronchitis ). ClinicalTrials.gov Identifier: NCT01791530 auspiciado  por la Sociedad Española de Medicina Intensiva, Crítica  y Unidades Coronarias (SEMICYUC) / Grupo de  Trabajo de Enfermedades Infecciosas (GTEI)    y la Federación Panamericana e Ibérica de Sociedades de  Medicina Crítica y Terapia Intensiva (FEPIMCTI). Año 2013.Resultados aún no publicados', NULL, NULL, NULL, NULL, '0379154632259', 'chdellera@yahoo.com.ar', NULL, '0362154511650', 'cucai_chaco@yahoo.com.ar', NULL, 49, NULL, 1, '2016-05-23 18:28:38', '2016-07-21 11:05:02', '5790d68e9fbbe.jpg', '2016-07-21 11:05:02'),
