(51, 587, 'Petcoff', 'Georgina Vanesa', 28653951, '1981-03-19', 0, NULL, '	Trabajo de Análisis del Sistema de Información de la empresa Amarilla Automotores S.A.- Cátedra: Sistemas de Información Gerencial- Año: 2001\r\n\r\n	Trabajo de Investigación: Análisis del Proceso Productivo de la Empresa TUBITO S.R.L.- Cátedra: Administración de Operaciones- Año: 2002\r\n	Encuesta Telefónica: Credibilidad de las Instituciones en las ciudades de Gran Resistencia y Corrientes –Cátedra: Investigación de Mercados- Año: 2002.\r\n\r\n	Proceso de Inscripción en Diferentes Organismos Fiscales, de una Sociedad Anónima, como figura societaria – Cátedra: Régimen Tributario- Año: 2003.\r\n	Trabajo de análisis estratégico y elaboración de una plan de negocios  de la empresa  “Supermercado  Iberia”-: Cátedra Administración estratégica- Año: 2003.\r\n	Elaboración de un proyecto de Inversión, desde la gestación de la idea hasta detalles operativos – Proyecto elegido: producción de hongos comestibles- Cátedra: Taller de Integración Interdisciplinario- Año: 2003.\r\n	Desarrollo de tesina  de grado: “Producción y comercialización de hongos comestibles. Plan de negocios para un emprendimiento hipotético ” Año: 2005-2006. \r\n	Participación activa en el desarrollo de manual de gestión de distribuidor de Lubricantes & Especialidades, Repsol YPF, Capital Federal,  agosto 2005.', 'Grupo CREAR SRL- Implementación de NORMAS ISO 9001:2000)\r\n1. Implementación y mantenimiento de Normas ISO 9001:2000 en el área de Distribuidor Diesel.\r\n2. Normalización de procesos y desarrollo del Manual de Calidad y procedimientos específicos y generales del área de Lubricantes y Especialidades de Grupo Crear S.R.L. \r\n3. Normalización de procesos y diseño de métodos de control para laboratorio  destinado al análisis de lubricantes. Diseño e implementación de tablero de control.\r\nDesarrollo de Gestión de Ventas\r\nDiseño, desarrollo, implementación y control de modelo de gestión de fuerza de ventas interna y externa del área de lubricantes y especialidades con el objetivo principal de alinear al personal a la estrategia definida por la gerencia del área.\r\nCheck list 2005 del área de distribuidor de Lubricantes & Especialidades y P.C.C. del distribuidor Diesel, defensa ante la auditoría sobre gestión para el premio nacional a la calidad en el manejo del negocio del distribuidor de lubricantes y especialidades.Obtención de 2do  premio Distribuidor de Lubricantes & Especialidades del año en base a modelo implementado en Congreso nacional de Distribuidores de Lubricantes y Especialidades, organizado por la división de Lubricantes & Especialidades de Repsol-YPF, de 4 días de duración en Mendoza, capital, septiembre 2005\r\nTRANSPORTES JORGE BONDAR E HIJOS S.R.L\r\nNormalización de procesos y desarrollo de Manual de Calidad y procedimientos específicos y generales para “TRANSPORTES JORGE BONDAR E HIJOS S.R.L.” en base a la filosofía de las Normas ISO 9001:2000.\r\nGrupo Carsa  ( Analista de Procesos desde junio 2006 a septiembre 2010)\r\nAnalista funcional de módulo HR  (OM , PA , TM  y PY ) de SAP, participación en proyecto de lanzamiento de portal SAP, diseño y rediseño de procesos varios de la compañía.\r\nParticipación como líder de procesos en equipo de implementación de módulo de HR  (OM, PA, TM y PY) de SAP.\r\nDiseño y mejora de procesos internos de Megatone y Confina. Introducción de procesos nuevos. Reingeniería de POS (punto de venta) y back office. Rediseños de procesos existentes. Soporte en el sostenimiento de procesos diseñados.\r\nAcciones relevantes: Conformación de grupo de implementación de módulos de FICO , MM  y Retail  de SAP  en Carsa S.A. y Credinea S.A. ( Megatone y Confina) : capacitación, desarrollo de Business Blueprints ( modelos de negocio a adoptar en base a herramientas propuestas por SAP y características particulares de la compañía), rediseño de circuitos internos y redefinición de políticas de MM y FICO para implementación de SAP. Capacitación a usuarios finales. \r\nAnálisis y diseño de Cadena de Valor de Carsa S.A. ( Megatone).', NULL, 'Auditoría Interna Normas ISO 9001:2000 en GRUPO CREAR SRL', '2do  premio Distribuidor de Lubricantes & Especialidades del año en base a modelo implementado en Congreso nacional de Distribuidores de Lubricantes y Especialidades, organizado por la división de Lubricantes & Especialidades de Repsol-YPF, de 4 días de duración en Mendoza, capital, septiembre 2005', '0362154681033', 'geopetcoff@hotmail.com', NULL, '0362154681033', 'geopetcoff@hotmail.com', NULL, 52, NULL, 1, '2016-05-24 21:20:34', '2016-06-29 11:19:39', '', '0000-00-00 00:00:00'),
(52, 372, 'MICHALUK', 'ARIEL GERMÁN', 28394638, '1980-08-09', 0, NULL, '•	III CONGRESO INTERNACIONAL DE CIENCIA Y TECNOLOGIA DE LOS ALIMENTOS – CORDOBA – ARGENTINA 2009 – TEMA: ¨Caracterización de las Propiedades Antioxidantes de Extractos de Brotes de Soja¨. Autores: MICHALUK, A.; DOVAL, M.; ROMERO, A.; JUDIS, M. A.; UNNE – FACULTAD DE AGROINDUSTRIAS – CHACO.\r\n•	AATA – XII CONGRESO CYTAL – CONCORDIA – ARGENTINA 2009 – TEMA: ¨Componentes Proteicos en Extractos Parcialmente Purificados de Brotes de Soja¨ - Autores: MICHALUK, A.; DOVAL, M.; ROMERO, A.; JUDIS, M. A.; UNNE – FACULTAD DE AGROINDUSTRIAS – CHACO.\r\n•	¨JORNADA DE DIVULGACION CIENTIFICA Y ACADEMICA DE LA UNIVERSIDAD NACIONAL DEL CHACO AUSTRAL¨ - Trabajo de Investigación: ¨Caracterización  de las Propiedades Antioxidantes de Extractos de Brotes de Soja¨. Autores: MICHALUK, A.; DOVAL, M.; ROMERO, A.; JUDIS, M. A. – 25 y 26 de noviembre de 2009 – Pres. Roque Sáenz peña – Chaco.\r\n•	¨REUNION DE DIFUSIÓN DE LAS LABORES DOCENTES CIENTÍFICAS Y TECNÓLOGICAS Y DE EXTENSIÓN ¨ - Trabajo de Investigación: ¨Propiedades Antioxidantes y Biológicas de los Extractos Deshidratados de Brotes de Soja¨. Autores: MICHALUK, A.; JUDIS, M. A.; DOVAL, M.; ROMERO, A. – 25 y 26 de noviembre de 2010 – Pres. Roque Sáenz peña – Chaco.\r\n•	¨REUNION DE DIFUSIÓN DE LAS LABORES DOCENTES CIENTÍFICAS Y TECNÓLOGICAS Y DE EXTENSIÓN¨ - Trabajo de Investigación: ¨Efecto del Tratamiento de Deshidratación Térmica Sobre la Actividad Antioxidante de Extractos Hidroalcohólicos de Brotes de Soja¨. Autores: MICHALUK, A.; BERTOLA, N; JUDIS, M. A.; DOVAL, M.; ROMERO, A. - 10 y 11 de agosto de 2011 - Pres. Roque Sáenz peña – Chaco.\r\n•	“CONGRESO LATINOAMERICANO DE INGENIERÍA Y CIENCIAS APLICADAS - CLICAP 2012” - Mendoza - ARGENTINA 2012 - TEMA: Extractos de Brotes de Soja Desecados. Propiedades Antioxidantes. - Autores: MICHALUK, A.; BERTOLA, N.; DOVAL, M.; ROMERO, A.; JUDIS, M. A.; UNCAus - CIDCA - CONICET.\r\n•	“REUNIÓN DE DIFUSIÓN DE LA LABOR DOCENTE, CIENTÍFICA Y TECNOLÓGICA Y DE EXTENSIÓN” – Universidad Nacional del Chaco Austral – Chaco – Argentina – 8 y 9 de agosto de 2012 – Presentación del Trabajo (Exposición): ¨Influencia del glicerol sobre las propiedades mecánicas de películas comestibles en base proteica¨, de los autores: MICHALUK, A.; BERTOLA, N.; ROMERO, A.; JUDIS, M.\r\n•	“IV CONGRESO INTERNACIONAL DE CIENCIA Y TECNOLOGÍA DE LOS ALIMENTOS” – Universidad Nacional de Córdoba – Córdoba - Argentina – 14 al 16 de noviembre del 2012 – Presentación del Trabajo (Poster y Completo): Propiedades físicas y térmicas de películas comestibles en base a proteína de suero de queso¨, de los autores: MICHALUK, A.; ROMERO, A.; JUDIS, M.; BERTOLA, N.\r\n•	“XIV CONGRESO ARGENTINO DE CIENCIA Y TECNOLOGÍA DE ALIMENTOS (CYTAL 2013)” – Centro de Eventos y Convenciones Metropolitano Rosario – Santa Fé – Argentina – 23 al 25 de noviembre del 2013 – Presentación del Trabajo (Poster y Completo): ¨Efecto del Almacenamiento Refrigerado sobre la Permeabilidad al Vapor de Agua y las Propiedades Mecánicas de Películas de Proteína de Suero de Quesería¨, de los autores: MICHALUK, A.; ROMERO, A.; JUDIS, M.; BERTOLA, N. \r\n•	“REUNIÓN DE DIFUSIÓN DE LA LABOR DOCENTE, CIENTÍFICA Y TECNOLÓGICA Y DE EXTENSIÓN” – Universidad Nacional del Chaco Austral – Chaco – Argentina – 13 y 14 de agosto de 2013 – Presentación del Trabajo (Exposición): ¨Propiedades físicas y térmicas de películas comestibles en base a proteínas de suero de queso¨, de los autores: MICHALUK, A.; ROMERO, A.; JUDIS, M.; BERTOLA, N.\r\n•	“REUNIÓN DE DIFUSIÓN DE LA LABOR DOCENTE, CIENTÍFICA Y TECNOLÓGICA Y DE EXTENSIÓN” – Universidad Nacional del Chaco Austral – Chaco – Argentina – 13 y 14 de agosto de 2013 – Presentación del Trabajo (Exposición): ¨Efecto del Almacenamiento Refrigerado sobre la Permeabilidad al Vapor de Agua y las Propiedades Mecánicas de Películas de Proteína de Suero de Quesería¨, de los autores: MICHALUK, A.; ROMERO, A.; JUDIS, M.; BERTOLA, N.\r\n•	“INTERNATIONAL CONFERENCE ON FOOD INNOVATION 2014 (FOODINNOVA 2014)” – Centro de Convenciones Concordia – Concordia – Entre Ríos – Argentina – 21 al 23 de octubre del 2014 – Presentación del Trabajo (Poster y Completo): ¨Películas comestibles adicionadas con extracto de brotes de soja: influencia sobre las propiedades mecánicas¨, de los autores: MICHALUK, A.; ROMERO, A.; JUDIS, M.; BERTOLA, N.\r\n•	“XVIII SEMINARIO LATINOAMERICANO Y V CONGRESO NACIONAL DE CIENCIA Y TECNOLOGÍA DE ALIMENTOS” – Centro Nacional de Ciencia y Tecnología de Alimentos - Universidad de Costa Rica – Costa Rica – 31 de marzo al 2 de abril del 2014 – Presentación del Trabajo (Poster): ¨Liberación de antioxidantes naturales desde películas de proteína de suero de quesería¨, de los autores: MICHALUK, A.; ROMERO, A.; JUDIS, M.; BERTOLA, N.\r\n•	 “CONGRESO LATINOAMERICANO DE INGENIERÍA Y CIENCIAS APLICADAS (CLICAP 2015)” – Universidad Nacional de Cuyo – Facultad de Ciencias Aplicadas a la Industria – San Rafael – Mendoza – Argentina – 15 al 17 de abril del 2015 – Presentación del Trabajo (Poster): ¨Recubrimiento comestible activo sobre hamburguesas de pescado cocidas y refrigeradas¨, de los autores: MICHALUK, A.; ROMERO, A.; JUDIS, M.; BERTOLA, N.\r\n•	 “REUNIÓN DE DIFUSIÓN DE LA LABOR DOCENTE, CIENTÍFICA Y TECNOLÓGICA Y DE EXTENSIÓN” – Universidad Nacional del Chaco Austral – Chaco – Argentina – 6 y 7 de agosto de 2014 – Presentación del Trabajo (Exposición): ¨Liberación de antioxidantes naturales desde películas de proteína de suero de quesería¨, de los autores: MICHALUK, A.; ROMERO, A.; JUDIS, M.; BERTOLA, N.\r\nMARA CRISTINA ROMERO; OSCAR ALFREDO GARRO; ANA MARÍA ROMERO; ARIEL GERMÁN MICHALUK; MIRTHA MARINA DOVAL; MARÍA ALICIA JUDIS. 2014. Assessment of the quality and shelf-life in enriched n3 PUFA raw beef patties using dry soybean sprouts as antioxidant. FOOD AND NUTRITION SCIENCES. Delaware: SCIENTIFIC RESEARCH PUBLISHING INC. Vol. N° 5. p 658 - 670. ISSN: 2157-944X.', NULL, NULL, NULL, NULL, '0364-154443658', 'arielmichaluk@uncaus.edu.ar', NULL, '0364-154443658', 'arielmichaluk@uncaus.edu.ar', NULL, 53, NULL, 1, '2016-05-24 21:52:06', '2016-06-29 11:14:03', '', '0000-00-00 00:00:00');
