nte:\r\nGeriatría y GerontologíaSub-Área del conocimiento: Informaciones adicionales: Es el primer programa de movilidad y capacitacion para el verdadero cambio de conducta en los adultos mayores (antes ciudadanos de la tercera edad). Lo interesante de este caso es que la obra social INSSEP aya accedido a pagar los costos de la puesta en funcionamiento de éste programa.\r\nPremios y/o distinciones Denominación del premio: Maniobras Kinésicas en Relación al Estado Ácido-Base en Pacientes en Estado Crítico Categoría: Colectivo (grupo de I+D, empresa innovadora, Grupo de productores/emprendedores, etcétera) Tipo de premio o distinción: Alcance geográfico: Internacional Nacional\r\nCIENCIAS MÉDICAS Y DE LA SALUD - Medicina ClínicaÁrea del conocimiento:\r\n1984Año:\r\nUNIV.NAC.DEL NORDESTE / FAC.DE MEDICINAInstitución otorgante:\r\nMedicina Critica y de EmergenciaSub-Área del conocimiento: Informaciones adicionales: Dicho trabajo fué ganador del Congreso Argentino del Capítulo Respiratorio y luego se compite contra otros como ser Capítulo Vascular, Capítulo Neurologia y Capítulo Traumatología.\r\n6.9. Evaluación de actividades científicas y tecnológicas.\r\nDA DALT LIVIO SERGIO C.C.I.: 2015-04-30 11:39:08 Página 32 de 39\r\n7. Producción artística\r\n8. Transferencias\r\n8.1. Transferencia de patentes y/u otra propiedad intelectual registrada.\r\nConsignar en la Solicitud de categorización, en el campo “Desarrollos transferidos”, la “Producción Tecnológica con Título de Propiedad Intelectual”, declarada en el CVar (punto 6.3 del CV), aquellas que fueron transferencias concretadas.\r\n8.2. Transferencia de investigación científica, desarrollo tecnológico y/o innovación tecnológica no registrada.\r\nTecnnovaTítulo de la invención:\r\nTipo de producción tecnológica: Bien de consumo intermedio o su/s componente/s\r\nNaturaleza de la producción Innovacion Tecnológica\r\nFecha de creación: 07/11/2014 Descripción de la invención: El Programa Tecnnova abre un espacio muy necesario en las Ciencias de la Salud en el que se podrán volcar todas las inquietudes tecnológicas, inventivas, creativas, innovadoras de productos, procesos y/o servicios en todo el espectro de el proceso salud-enfermedad. Las área temáticas incluyen: metrología en salud, telemedicina y telerehabilitacion, desarrollo de software, desarrollo de simuladores clínicos, tecnologías por microchips, Polo Postural, gerontotecnologías, mejora comunicacional, Fitomedicina, turismo salud, innovación social y otras.\r\nÁrea del conocimiento: CIENCIAS MÉDICAS Y DE LA SALUD - Biotecnología de la Salud\r\nSub-área del conocimiento: Otras Biotecnologías de la Salud\r\nTecnologia sanitaria y curativa-VariosCampos de aplicación:\r\nAutores: Nombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA Livio Sergio Da Dalt\r\nNombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA LAURA ELIZABETH LEYES\r\n100%Porcentaje de participación en la\r\nInstitucion que financia la producción % financiación\r\nUNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA 100\r\nDivulgada con aplicaciónTipo de transferencia:\r\nAcuerdoForma de transferencia:\r\nAño inicio Año fin Tipo de edentidad adquirente Entidad adquirente Pais 2014 2016 Universidad o instituto universitario estatal UNNE Argentina\r\nSimulador de GeronteTítulo de la invención: Tipo de producción tecnológica: Máquina, equipo, instrumento y/o herramienta o su/s componente/s\r\nNaturaleza de la producción Electrónica\r\nFecha de creación: 02/08/2014 Descripción de la invención: Se crea un Simulador de Geronte parecido a los que se pueden encontrar en internet y se le agrega un dispositivo electrónico; a través de un Microchips de marca Arduíno;  que genera un\r\nDA DALT LIVIO SERGIO C.C.I.: 2015-04-30 11:39:08 Página 33 de 39\r\n8.2. Transferencia de investigación científica, desarrollo tecnológico y/o innovación tecnológica no registrada.\r\nimpulso eléctrico estimulante con una frecuencia que \"simula\" el temblor clásico del Parkinsonismo, propio de algunos Adultos Mayores, y además se crea un circuito para la verdadera percepción por parte del que lo use de una gran similitud a un geronte, para de esta manera poder brindar esas sensaciones multidimensionales a los alumnos de las carreras de Ciencias de la Salud y a todo ciudadano que quiera percibir como siente un anciano. La verdadera innovación está en el agregado del Microchips que suma el temblor del parkinsonismo mas el diseño de un circuito que asegura la toma propioceptiva, visual, cenestésica del esquema corporal y su movimiento en el espacio.\r\nÁrea del conocimiento: CIENCIAS MÉDICAS Y DE LA SALUD - Biotecnología de la Salud Sub-área del conocimiento: Biomateriales (los relacionados con implantes, aparatos y sensores médicos) Tecnol.sanit.y curativa-Instrum.de rehabilitCampos de aplicación:\r\nAutores: Nombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA Livio Sergio Da Dalt\r\nNombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA Alejandro Rios\r\n100%Porcentaje de participación en la\r\nInstitucion que financia la producción % financiación\r\nUNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA 100\r\nDivulgada con aplicaciónTipo de transferencia:\r\nAcuerdoForma de transferencia:\r\nAño inicio Año fin Tipo de edentidad adquirente Entidad adquirente Pais 2014 2016 Universidad o instituto universitario estatal UNNE Argentina\r\nSoftware Simulador de Arritmias CardíacasTítulo de la invención: Tipo de producción tecnológica: Máquina, equipo, instrumento y/o herramienta o su/s componente/s\r\nNaturaleza de la producción Informática (software)\r\nFecha de creación: 29/07/2014 Descripción de la invención: El Software de Arritmias Cardíacas, Vortex, es un medio educativo Universitario para que el alumno de las ciencias de la salud entienda como es el manejo eléctrico del corazón en estado normal y en situaciones patológicas y a la vez como reaccionaria ante distintas dosis de medicamentos antiarrítmicos y sus efectos. La Facultad de Medicina UNNE firmo un Acuerdo de cesión de Licencia Tecnológica del Vortex para comercializarlo en todas las universidades de Latinoamérica, por el cual pagó un canon; todo esto se realizó por intervención del Área de Vinculacion y Transferencia Tecnológica a cargo del autor de este CV, por lo que aparezco como autor con un 2%, pero no es real que sea autor , si que facilité que esto se concretara, pero si no me coloco allí no me toma esta cesión tecnológica y fue la única manera que encontré de poder incluirlo.\r\nÁrea del conocimiento: CIENCIAS MÉDICAS Y DE LA SALUD - Biotecnología de la Salud\r\nSub-área del conocimiento: Biotecnología relacionada con la Salud\r\nDA DALT LIVIO SERGIO C.C.I.: 2015-04-30 11:39:08 Página 34 de 39\r\n8.2. Transferencia de investigación científica, desarrollo tecnológico y/o innovación tecnológica no registrada.\r\nTecnol.sanit.y curativa-OtrosCampos de aplicación:\r\nAutores: Nombre Institución INSTITUTO CORDIS Alejandro Ventura\r\nNombre Institución UNIVERSIDAD TECNOLOGICA NACIONAL Justo Vargas\r\nNombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA Livio Sergio Da Dalt\r\n2%Porcentaje de participación en la\r\nInstitucion que financia la producción % financiación\r\nUNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA 100\r\nDivulgada con aplicaciónTipo de transferencia:\r\nAcuerdoForma de transferencia:\r\nAño inicio Año fin Tipo de edentidad adquirente Entidad adquirente Pais 2013 2016 Universidad o instituto universitario estatal UNNE Argentina\r\nInnovación Social en Facultad de MedicinaTítulo de la invención:\r\nTipo de producción tecnológica: Modelo de organización y/o gestión\r\nNaturaleza de la producción Organizacional\r\nFecha de creación: 07/06/2014 Descripción de la invención: La Innovación Social como verdadero paradigma que puede ayudar a solucionar infinidad de problemas o situaciones a bajo costo y alto impacto, partiendo de la practicidad, la apertura de ideas, la solidaridad a través de un concepto QUE PUEDO HACER para ayudar al otro, al próximo, sin grandes movimientos, costos ni grandilocuencias; en esta oportunidad compartimos veinte (20) ideas o adaptaciones que cumplan con ese concepto: práctico, rápido, fácil y solidario. Siempre con respeto al medioambiente, a nuestros valores culturales y ayudando en algo a los actores de la UNNE, Facultad de Medicina : alumnos, docentes y personal de gestión.\r\nÁrea del conocimiento: CIENCIAS MÉDICAS Y DE LA SALUD - Biotecnología de la Salud\r\nSub-área del conocimiento: Biotecnología relacionada con la Salud\r\nTecnologia sanitaria y curativa-VariosCampos de aplicación:\r\nAutores: Nombre Institución INST.NAC.DE TECNOLOGIA AGROPECUARIA / CENTRO REG.CORRIENTES Pablo Morales Andreau\r\nNombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA Pablo Lopez Hortt\r\nNombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA Alejandro Rios\r\nNombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA Livio Sergio Da Dalt\r\n100%Porcentaje de participación en la\r\nInstitucion que financia la producción % financiación\r\nUNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA 100\r\nDA DALT LIVIO SERGIO C.C.I.: 2015-04-30 11:39:08 Página 35 de 39\r\n8.2. Transferencia de investigación científica, desarrollo tecnológico y/o innovación tecnológica no registrada.\r\nDivulgada con aplicaciónTipo de transferencia:\r\nAcuerdoForma de transferencia:\r\nAño inicio Año fin Tipo de edentidad adquirente Entidad adquirente Pais 2014 2016 Universidad o instituto universitario estatal UNNE Argentina\r\nPrograma de Salud en el Trabajo (PST) Coca Cola-UNNETítulo de la invención:\r\nTipo de producción tecnológica: Modelo de organización y/o gestión\r\nNaturaleza de la producción Organizacional\r\nFecha de creación: 02/06/2014 Descripción de la invención: El Programa de Salud en el Trabajo (PST) Coca Cola-UNNE se realiza a pedido de la empresa internacional a los fines de mejorar la salud, los controles clínicos y fortalecer el medio ambiente laboral de sus empleados. se realiza en forma de Módulos que a su vez permiten una certificación de dichos pasos; por ejemplo \"Empresa libre de Humos\", certificaciones Ergonómicas y otras, juntas van construyendo un mejor ambiente en el trabajo con individuos sanos y bajo control de sus posibles enfermedades; esto lo convierte en una acción Preventiva y curativa, donde la Patronal realiza actos proactivos hacia la salud de su fuerza laboral y los empleados perciben que su patronal se pre-Ocupa de ellos.\r\nÁrea del conocimiento: CIENCIAS MÉDICAS Y DE LA SALUD - Ciencias de la Salud\r\nSub-área del conocimiento: Salud Pública y Medioambiental\r\nPrestaciones sanitarias-Medicina preventivaCampos de aplicación:\r\nAutores: Nombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA Livio Sergio Da Dalt\r\nNombre Institución UNIV.NAC.DEL NORDESTE / RECTORADO Universidad Nacional del Nordeste\r\n100%Porcentaje de participación en la\r\nInstitucion que financia la producción % financiación\r\nCOCA COLA 100\r\nDivulgada con aplicaciónTipo de transferencia:\r\nAcuerdoForma de transferencia:\r\nAño inicio Año fin Tipo de edentidad adquirente Entidad adquirente Pais\r\n2014 2015 Empresa Coca Cola Argentina\r\nEcovia Saludable PROMEBA UNNETítulo de la invención:\r\nTipo de producción tecnológica: Modelo de organización y/o gestión\r\nNaturaleza de la producción Organizacional\r\nFecha de creación: 17/05/2014 Descripción de la invención: Desarrollo de un circuito aeróbico específico para poblaciones adultas mayores y adolescentes con exceso de peso corporal, de un barrio vulnerable de Resistencia Chaco; que se describe como Ecovia Saludable sobre la Av. Honduras y que se implementará sobre las veredas del barrio y de espacios para la complementacion de distintas actividades físicas como ser\r\nDA DALT LIVIO SERGIO C.C.I.: 2015-04-30 11:39:08 Página 36 de 39\r\n8.2. Transferencia de investigación científica, desarrollo tecnológico y/o innovación tecnológica no registrada.\r\nelongaciones, estiramientos trotes, fortalecimientos funcionales, ganancia articular y otros. Este desarrollo empieza con la creación del circuito para luego ir incorporando controles incrementales, cartelería, escalonamiento eslabonado de los distintos estadios clínicos de los ciudadanos, todo debidamente registrado y ejecutado con un criterio organizacional que permitirá cometer la menor cantidad de errores en la ejecución del Programa, Y ALLÍ EMPEZAR LA TRANSFERENCIA TECNOLÓGICA DEL LA GESTIÓN DEL PROYECTO ECOVÍA SALUDABLE\r\nÁrea del conocimiento: CIENCIAS MÉDICAS Y DE LA SALUD - Ciencias de la Salud\r\nSub-área del conocimiento: Salud Pública y Medioambiental\r\nPrestaciones sanitarias-Medicina preventivaCampos de aplicación:\r\nAutores: Nombre Institución UNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA Livio Sergio Da Dalt\r\nNombre Institución PROMEBA PROGRAMA DE MEJORAMIENTO BARRIAL PROMEBA Nación\r\n100%Porcentaje de participación en la\r\nInstitucion que financia la producción % financiación\r\nPROMEBA NACION 80\r\nUNIV.NAC.DEL NORDESTE / FAC.DE MEDICINA 20\r\nDivulgada con aplicaciónTipo de transferencia:\r\nAcuerdoForma de transferencia:\r\nAño inicio Año fin Tipo de edentidad adquirente Entidad adquirente Pais 2014 2016 Entidad administrativa de gobierno PROMEBA  NACION Argentina\r\nProyecto Marca Propia para la Facultad de Medicina UNNETítulo de la invención:\r\nTipo de producción tecnológica: Bien de consumo final o su/s componente/s\r\nNaturaleza de la producción Social\r\nFecha de creación: 02/03/2014 Descripción de la invención: Se propone la creación de una marca propia para la Facultad de Medicina UNNE, al fin de posicionar toda campaña de actividades preventivas y curativas relacionadas con el proceso de saludenfermedad; la adopción de un isologo propio, adquirido por concurso interno, que represente todos los valores que conllevan las acciones, publicidades y normativas hacia la sociedad desde la Unidad Académica Medicina, y desde allí poder construir aciertos en las políticas públicas relacionadas a la salud 