(123, 920, 'RICCIARDI VERRASTRO', 'BARBARA VERONICA', 33357603, '2017-09-28', 1, 'Doctorado en Química de la UNNE Res. N°1295/13', 'Libro\r\n- Plantas como antiveneno: del mito al logos. (2015). Ana María Torres; Francisco Camargo; Ricciardi Verrastro, Bárbara Verónica, Gabriela Ricciardi; Eduardo Dellacassa. Editorial Comisión Sectorial de Investigación Científica (CSIC). Montevideo, Uruguay. Biblioteca Popular. ISBN 978-9974-0-1279-0. Financiado por el Programa de Apoyo a Publicaciones Modalidades: Libros, fascículos y Números monográficos de revista 2014. \r\n\r\nPublicaciones con referato de artículos de investigación\r\n- Validación del uso tradicional de especies de Asclepias en el Nordeste Argentino contra veneno de Bothrops diporus (yarará chica). Ricciardi Verrastro, Barbara V.; Torres, Ana M.; Camargo, Francisco J.; Dellacassa, Eduardo. BLACPMA 15 (2): 112. ISSN 0717 791.\r\n - In vitro anti-snake venom activities of Aloysia citriodora Palau: new possibilities for a known aromatic plant. Caceres Wenzel, Marcela; Torres, Ana María; Ricciardi Verrastro, Bárbara; Ricciardi, Gabriela; Dellacassa, Eduardo. Journal of Essential Oil Bearing Plants. DOI: 10.1080/0972060X.2016.1239551. ISSN: 0972-060X (Print) 0976-5026 (Online)\r\n\r\nPublicaciones de resumenes de trabajos de investigación presentados en congresos\r\n- El modelo Aloysia citriodora: estudio in vitro de la actividad alexitérica del aceite esencial. (2012). Marcela Cáceres Wenzel, Ana María Torres, Gabriela Ricciardi, Bárbara Ricciardi Verrastro, Armando Ricciardi y Eduardo Dellacassa. Dominguezia. Vol 28 (2): 66-67. ISSN 1669-6859.\r\n- Aceite esencial de Ocotea acutifolia: química y actividad alexítera. (2012). Juan José Ruiz Díaz, Ana María Torres, Bárbara Ricciardi Verrastro, Gabriela Ricciardi, Armando I.A. Ricciardi y Eduardo Dellacassa. Dominguezia. Vol 28 (2): 67-68. ISSN 1669-6859.\r\n- Validación del uso de Sida tuberculata y Sida rhombifolia en el tratamiento de accidentes ofídicos con Bothrops diporus. (2013). Bárbara V. Ricciardi Verrastro, Ana M. Torres, Gabriela A. L. Ricciardi, Armando I. A. Ricciardi, Eduardo S. Dellacassa. Dominguezia (29 Suplemento) A5-46: 117. ISSN 1669-6859.\r\n- Actividad antimicrobiana de extractos y aceites de plantas del nordeste argentino. (2013). Ana M. Torres, Susana Ferrero, Gabriela A. Ricciardi, Bárbara V. Ricciardi Verrastro, Marcela Cáceres Wenzel, Armando I. Ricciardi, Eduardo S. Dellacassa. Dominguezia (29 Suplemento) A5-56: 123. ISSN 1669-6859.\r\n- Extractos de Cissampelos pareira: inhibidores de la actividad coagulante del veneno de Bothorps diporus. Ricciardi Verrastro, B;  Torres, A; Dellacassa, E. Libro de resúmenes SAFE B-VII: 37. ISSN 2250-4079. \r\n-Actividad del Jazmin del Paraguay contra Bothrops diporus. Scaramellini Burgos, M. S.; Ricciardi Verrastro, B; Torres, A.; Dellacassa, E. Libro de resúmenes SAFE B-VII: 40. ISNN 2250-4079. \r\n- Casearia sylvestris: una especie activa contra veneno de yarara chica? Ricciardi Verrastro, B.V., Torres, A.M., Dellacassa, E.S. Ricciardi, G.A.L. LILLOA. ISSN 0075-9481.\r\n-Actividad cruzada del extracto alcohólico de Cissampelos pareira contra veneno de yarará chica. Ricciardi Verrastro, B; Dellacassa, E; Torres, A. Libro de resúmenes SAFE O-III-9-66. ISSN 2250-4079.\r\n-Acción de Flaveria bidentis sobre la actividad coagulante del veneno de Bothorps diporus. Baroni Pietto, M C; Ricciardi Verrastro, B;  Torres, A. Libro de resúmenes SAFE B-V-125-292. ISSN 2250-4079.\r\n-Fracciones activas de Brunfelsia uniflora contra el veneno de especies de Bothorps. Scaramellini Burgos, S; Ricciardi Verrastro, B; Ricciardi, G; Torres, A. Libro de resúmenes SAFE B-XI-259-108. ISSN 2250-4079.\r\n-Screening de la actividad antioxidante de algunas plantas medicinales del Nordeste Argentino. Ricciardi, G; Torres, A, Ricciardi Verrastro, B; Scaramellini Burgos, S; Baroni Pietto, M C. Libro de resúmenes SAFE B-IX-323-322. ISSN 2250-4079.\r\n- Inhibición de la actividad del veneno de Bothrops diporus mediante una formulación de aplicación tópica con extractos de Cissampelos pareira. Ricciardi Verrastro, B;  Ricciardi, G; Teibler, P; Lozina, L; Maruñak, STorres; Dellacassa, E; Torres A. Rev. Medicina 76 (Suplemento I): 280. ISSN 1669-9106.', NULL, NULL, 'Auditor Interno (en formación) del Laboratorio de Química Legal del IMCiF - Dependencia del Poder Judicial del Chaco - Norma IRAM ISO 9001 - 2008', NULL, '379 4775653', 'barb_ricciardi@hotmail.com', NULL, '362 4468651', 'bveronica.riccardiverrastro@justiciachaco.gov.ar', NULL, 124, NULL, NULL, '2017-05-03 19:06:03', '2017-05-03 19:06:04', NULL, NULL),
(124, 429, 'Aparicio', 'Maria Sofia', 31294466, '1985-04-05', 0, NULL, 'Colaboración en trabajos de Investigación por contar con una Beca de Prestación Efectiva de Servicios de la Facultad de Ciencias Económicas. (S/Res. Nº 1822/2010 -Rectorado UNNE). Actividades Económicas Regionales.', '- Responsable de Calidad y Servicio Relación Cliente del Concesionario Car France SA.\r\nEn dicha organización tenia a mi cargo antes que nada la formación del puesto, descripción del mismo y tareas vinculadas.\r\nManejo de la información destinada al call center y los resultados de su tratamiento como así también de las encuestas realizadas desde la marca y su evolución.\r\nInformar los requerimientos establecidos por la marca en cuanto a imagen y atención al cliente. Velar por su cumplimiento.\r\nObrar de intermediario entre la marca, el concesionario y los reclamos recibidos de clientes, para de manera asegurar su tratamiento.\r\n\r\n- Implementación de SGC Bajo normas ISO 9001:2015.\r\nActualmente me encuentro dictando para una consultora privada, un curso de capacitación referido a Introducción a la implementan de Sistemas de Gestión de Calidad bajo las Normas ISO 9001:2015.', 'Premio Provincial a la Calidad -Chaco Edición 2013\r\nPremio Provincial a la Calidad -Chaco Edición 2014\r\nPremio Provincial a la Calidad -Chaco Edición 2015', '- Como Responsable de Calidad, debía realizar auditorias internas y acompañar las externas realizadas con el fin de cumplir los requerimientos establecidos por la marca tanto en imagen como los referidos a atención al cliente para el concesionario.', NULL, '0362154662332', 'sofia85_41@hotmail.com', NULL, '0362154662332', 'sofia85_41@hotmail.com', NULL, 125, NULL, NULL, '2017-05-03 23:49:49', '2017-05-03 23:49:50', NULL, NULL),
