INSERT INTO `organizacion` (`id`, `nombre`, `responsable_organizacion_apellido`, `responsable_organizacion_nombre`, `responsable_organizacion_funcion`, `responsable_en_premio_apellido`, `responsable_en_premio_nombre`, `responsable_en_premio_funcion`, `actividad_principal`, `anio_inicio_actividades`, `contacto_organizacion_telefono`, `contacto_organizacion_email`, `contacto_organizacion_web`, `responsable_organizacion_contacto_telefono`, `responsable_organizacion_contacto_email`, `responsable_organizacion_contacto_web`, `responsable_en_premio_contacto_telefono`, `responsable_en_premio_contacto_email`, `responsable_en_premio_contacto_web`, `discriminador`, `premio_id`, `created_by_id`, `updated_by_id`, `created_at`, `updated_at`, `estado`) VALUES
(1, 'DIRECCIÓN DE EDUCACIÓN HOSPITALARIA Y DOMICILIARIA M.E.C.C Y T', 'Bogado', 'Silvina', 'Equipo Técnico Pedagógico', 'Carabajal', 'Verónica', 'Directora', 'La Educación Domiciliaria y Hospitalaria es la modalidad del Sistema Educativo, destinada a garantizar el derecho a la educación a los alumnos que, por atravesar una situación de enfermedad, de carácter transitorio o permanente, se ven imposibilitados de asistir con regularidad a una institución educativa en los niveles de educación obligatoria. (Ley 26.206 Art. 94, 95,96).\r\n\r\nLa presencia del niño/ adolescente  en el hospital esta determinada por la patología diagnosticada significándole estudios médicos de distintos tipos análisis clínicos, técnicas quimioterapéuticas, diálisis, radioterapia, intervenciones quirúrgicas de variada complejidad, etc. Con tramos de internación corta y/ o prolongad, o en calidad de paciente ambulatorio.\r\n\r\nEn este contexto la predisposición para los aprendizajes sistemáticos esta atravesada por la circunstancia vivencial. Entonces, resulta imperioso proponer el tratamiento de contenidos surgidos de la realidad cotidiana individual.\r\nLa pedagogía cobra aquí, una revitalización al estimular procesos de aprendizajes durante el desarrollo del niño / adolescente, trabajando con las figuras parentales y los agentes sociales determinantes. Esta postura pedagógico/ didáctica esta fundamentada en la concepción constructivista, posibilitadora de la subjetividad e imbricada con el concepto de  RESILIENCIA que valoriza los factores protectores de la historia personal inherente al paciente familia, experiencias previas, instituciones, profesionales intervinientes de salud y educación que acompañan su inserción en la vida. \r\n\r\nAsí se facilita la articulación/ integración escolar( un medio estratégico metodológico) a cada proyecto educativo original y partiendo de la premisa …..La integración es un proceso que comporta la reciprocidad, envuelve a todos los elementos de un contexto, supone una adecuación a las necesidades y a los recursos existentes…. Especificaremos este concepto desde el marco del trabajo de la escuela hospitalaria.\r\n\r\nEl mayor porcentaje de estas escuelas y servicios, dependen  de la modalidad de Educación Especial y Servicio de Salud. En su mayoría son escuelas Especiales con servicios hospitalarios y/o domiciliarios agregados.\r\n\r\nEl objetivo de esta modalidad es garantizar la igualdad de oportunidades a los alumnos, permitiendo el acceso al sistema común, la continuidad de sus estudios y la reinserción, cuando ello sea posible / Ley 26.206 Art 61,  evitando así las consecuencias que la enfermedad ocasiona en la escolaridad de estos niños / adolescentes/ jóvenes ausentismo, repitencia, deserción escolar. Apuntando siempre a una educación inclusiva, que se refiere a la capacidad del Sistema Educativo de atender a todos los estudiantes de una comunidad y que aprendan juntos, independientemente de sus condiciones personales, sociales o culturales.', 2014, '154879887', 'coord.educ.dyh@gmail.com', 'http://coord.educ.dyh', '1544879887', 'silvinabogado582@hotmail.com', NULL, '154879887', 'verocar_35@hotmail.com', NULL, 'organizacion_publica', 1, NULL, 1, '2016-05-02 09:49:54', '2016-07-19 10:07:48', 'no aceptado'),
(3, 'Nelson Melli Construcciones SACICIF    (HORMIGONES MELMIX)', 'Melli', 'Nelson', 'Presidente', 'Roshdestwensky', 'Kristel', 'Jefe de Departamento de Control de Calidad', 'En Nelson Melli Construcciones SACICIF actualmente nos dedicamos exclusivamente a la producción y provisión de hormigón elaborado y servicios afines a la industria de la construcción.\r\nLa elaboración y el control de calidad de nuestros productos se realiza bajo los requisitos de la Norma IRAM 1666 - Parte I, II y III, y el reglamento CIRSOC 201:2005.\r\nActualmente se cuenta con un sistema de gestión de la calidad certificado bajo la norma ISO 9001:2008 orientada a realizar mejoras continuas en sus procesos productivos, por el ente certificador Lloyds Register Quality Assurance Limited.', 1985, '03624463570', 'mdagnino@melmix.com.ar', 'http://www.nelsonmelli.com.ar', '03624463570', 'nelsonmelli@melmix.com.ar', NULL, '03624463570 - 0362154822834', 'kristelrosh@melmix.com.ar', NULL, 'organizacion_privada', 1, NULL, 1, '2016-05-06 12:15:09', '2016-07-21 18:49:04', 'activo'),
(7, 'ECOM CHACO S.A.', 'FLASCHKA', 'ADOLFO LEANDRO', 'PRESIDENTE', 'GOMEZ CENIQUEL', 'ETHEL TAMARA', 'Analista', 'EL OBJETO SOCIAL DE LA EMPRESA ES: La Sociedad tiene por objeto realizar por cuenta propia, de terceros o asociada a terceros, en el país o en el extranjero, las siguientes actividades: a) La prestación de servicios informáticos; b) impresiones; c) Prestación de servicios de telecomunicaciones, radiodifusión y servicios de comunicación audiovisual, tales como: Servicio básico telefónico local, nacional e internacional, telefonía pública, telefonía móvil celular, terrestre y satelital, transporte de señales de radiodifusión (radio y televisión), valor agregado (Internet y otros), transmisión de datos, facilidades esenciales para la prestación de servicios de telecomunicaciones  y desarrollo de futuros servicios interactivos y de multimedia, y cualquier otro servicio de Telecomunicaciones, encuadrado en el marco regulatorio actual o los que pudieran incluirse y reglamentarse en el futuro bajo normas internacionales de calidad de tal manera que se permita la comercialización del servicio, su producción y/o distribución nacional e internacional. Investigación y desarrollo de nueva tecnología de las comunicaciones y producción de equipos y sistemas de telecomunicaciones. Destacándose asimismo la capacidad para efectuar solicitudes de espectro necesarias para la prestación de los servicios conforme la normativa vigente en la materia. La enumeración precedente es enunciativa y no taxativa pudiendo en definitiva desarrollar toda actividad necesaria para el cumplimiento del objeto social. \r\n La importación, exportación, compra, venta, distribución, consignación y representación de productos relacionados con la prestación de servicios informáticos, impresiones y la industria de las telecomunicaciones en cualquier punto del país o el exterior, pudiendo presentarse en licitaciones y/o concursos públicos de precios o de obras que fueran llamados por instituciones publicas y/o privadas; d) Elaboración de proyectos y ejecución de obras de infraestructuras, civiles e instalaciones eléctricas que sean necesarias a fin de desarrollar las actividades que hacen a su objeto social; e) brindar servicios de consultoría, integración, capacitación, implementación y asesoramiento relacionado con estas materias; f) la provisión y comercialización de los insumos de estas actividades. Podrá, asimismo, importar, exportar, arrendar, subarrendar, vender y/o celebrar otro tipo de contratos con relación a los elementos que se utilizan para las actividades que constituyen el objeto social.\r\nPara el cumplimiento de su objeto la Sociedad goza de plena capacidad pudiendo realizar toda clase de actos jurídicos y operaciones que se relacionen directa o indirectamente con aquél alentando, apoyando y realizando toda actividad destinada al desarrollo y difusión de tecnologías respetuosas de la preservación de medio ambiente, en un todo de acuerdo con el artículo Nº 41 de la Constitución Nacional así como lo dispuesto en el artículo 38 de la Constitución de la Provincia del Chaco.”  \r\nEcom Chaco SA es una empresa dedicada al estudio, análisis y desarrollo de nuevas tecnologías y su aplicación en la administración pública y privada. Está a cargo de un Directorio y brinda servicios de comunicaciones, tecnologías de la información, soporte técnico, capacitación a usuarios, y servicios de diseño, análisis, desarrollo e implementación de aplicativos que puedan adaptarse a diferentes plataformas tecnológicas. Provee soluciones de software a medida abarcando temáticas como contabilidad, gestión y  salud. La principal herramienta de desarrollo es Genexus. Algunos productos se encuentran en proceso de prueba e investigación, como ser bases de datos, software para dispositivos móviles, Sistema de Información Geográfica, etc. Actualmente posee un liderazgo tecnológico regional que avanza hacia el resto del país, con una proyección internacional. Dispone de experiencia en el desarrollo de grandes sistemas y en trabajo con equipos interdisciplinarios, y los sistemas contribuyen a generar información para la toma de decisiones del Estado. \r\nEcom se encuentra en la etapa de reestructuración organizacional, con lo cual, la decisión de participar del premio es más que oportuna., para soportar su estructura informática actualizada, su proyección de negocios, y la mejora continua de los servicios que presta actualmente. \r\nECOM Chaco forma parte del Polo IT Chaco de empresas tecnológicas y de la industria del software, lo cual  representa un paso más hacia la integración y el fortalecimiento del sector informático de la provincia que impulsa el Estado Provincial.\r\nPosee recursos humanos con alto nivel académico y estrecha relación con universidades como ser UTN y UNNE.\r\nECOM posee certificaciones de calidad ISO 9001 y  CMMI, que actualmente no están vigentes, pero que dejaron cierto orden en algunos sectores.\r\nLa infraestructura de comunicaciones de la empresa es única en el país. Tiene proyectado la ampliación de su alcance, de la mejora en el tráfico actual, y de incrementar los niveles de seguridad para brindar otros servicios que forman parte de su futuro negocios de comunicaciones. \r\nParticipa de eventos y jornadas de capacitación  a nivel internacional.', 1977, '0362-4419300', 'at.usuarios@ecomchaco.com.ar', 'http://www.ecomchaco.com.ar', '0362-4419300', 'presidencia@chaco.gov.ar', NULL, '0362 4419300 int 4021', 'tgceniquel@chaco.gov.ar', NULL, 'organizacion_publica', 1, NULL, 1, '2016-05-06 14:01:29', '2016-08-04 10:20:07', 'activo'),
