(11, 'COOPERATIVA DE PRODUCTORES APICOLA COPAP LIMITADA', 'chichari', 'jose', 'Presidente', 'chichari', 'jose', 'Presidente', 'Cooperativa que se dedica a la producción de Miel y a su comercialización en la forma de \"a granel\" y fraccionado en distintas medidas de pesos y envases.Todos nuestros productos certifican proceso de calidad alimentaria aprobados por el ALMAT , en concordancia con el Código Alimentario Argentino y a normas internacionales para exportación fraccionada conocida como Normas HAZZARD o su versión en castellano A:P:P:C.(Análisis de Peligros y Puntos Critico de Control. Tambien Certificamos MIEL LIBRE DE GLUTEN,Para la comunidad Judia Certificamos el Proceso de Calidad Kosher y estamos prontos a obtener el Sello de Calidad Alimentos Argentino una opción de Calidad \" para mieles a granel y fraccionado (estamos siendo auditados por el I.N.T.I).Para lograr lo antes mencionados tenemos un Establecimiento Modelo para toda esta parte del Pais, no solo por la calidad edilicia sino por que somos los únicos que en el rubro Certificamos procesos de Calidad dando le valor Agregado a nuestra produccion y representando a la Provincia del Chaco en Ferias internacionales como la Fancy Food en Nueva York Estados Unidad 2013,', 2005, '03624517205', 'coopcopap@gmail.com', 'http://www.mielchacocopap.com.ar', '03624517205', 'coopcopap@gmail.com', NULL, '03624517205', 'coopcopap@gmail.com', NULL, 'organizacion_privada', 1, NULL, 1, '2016-05-10 11:32:24', '2016-08-04 12:35:54', 'baja'),
