(16, 'CENTRO UNICO COORDINADOR DE ABLACIÓN E IMPLANTE DEL CHACO-(C.U.C.A.I. CHACO)', 'DELLERA', 'CHRISTIAN', 'DIRECTOR', 'DELLERA', 'CHRISTIAN', 'DIRECTOR CUCAI CHACO', 'Referente Provincial y ente consultor del Ministerio de Salud Pública del Chaco en todo lo referente a las distintas etapas del Proceso de Donación y Trasplante: fiscalización de Listas de Espera y Equipos de Trasplante, diagramación de las distintas actividades de capacitación y difusión y presencia en las redes sociales , detección , diagnostico y mantenimiento de potenciales donantes de órganos, tejidos y células.Ente de aplicación en el ámbito provincial de toda la regulación nacional y provincial de la temática', 1994, '0362-4453535/34', 'cucai_chaco@yahoo.com.ar      prensacucaichaco@gmail.com', NULL, '0362-154511650', 'chdellera@yahoo.com.ar', NULL, '0362-154511650   0379-154632259', 'chdellera@yahoo.com.ar', NULL, 'organizacion_publica', 1, NULL, 1, '2016-05-18 09:55:51', '2016-07-21 18:49:49', 'activo'),
