(20, 'Subsecretaria de Trabajo de la Provincia del Chaco', 'Spoljarick', 'Liliana', 'Secretaria de Trabajo', 'Trangoni', 'Gustavo Javier', 'Subsecretario de Trabajo', 'MISIONES Y FUNCIONES\r\n\r\nLa Secretaría de Trabajo de la Provincia del Chaco es el órgano con competencia y  jurisdicción     para    entender   en     materia   de    trabajo   en    la  provincia  del Chaco. \r\n\r\nTendrá  Dos direcciones: (1) Dirección Provincial del Trabajo con base en la ciudad capital (Resistencia) y Delegaciones Regionales establecidas en Sáenz Peña, Villa Ángela, Gral. San Martin, Charata, Castelli. Las Direcciones y Delegaciones Regionales dependerán en forma directa de la Subsecretaría de Trabajo.\r\n\r\n\r\nFunciones \r\n\r\na) Difundir, organizar y coordinar las actividades jurídicas administrativas del organismo laboral, sus Delegaciones Regionales e Inspectorías Zonales.\r\nb) Promover el perfeccionamiento de la legislación laboral, proponiendo los proyectos correspondientes, como órgano asesor de los poderes públicos Provinciales.\r\nc) Difundir, aplicar y vigilar la legislación laboral vigente; a tal fin, realizará campañas que pongan en conocimiento de obreros y empleadores acerca de sus derechos y obligaciones, nuevos métodos de seguridad, higiene o salubridad industrial.\r\nd) Prevenir y solucionar conflictos de trabajo, coordinando la actuación de la Dirección con los organismos de la Nación; en los casos que corresponda.\r\ne) Organizar en todo el territorio de la Provincia la Policía de Trabajo, adoptando las medidas necesarias para asegurar el cumplimiento de leyes, decretos, convenios colectivos, reglamentaciones y además; normas legales en materia laboral.\r\nf) Intervenir o decidir en la conciliación y arbitraje de los conflictos individuales del trabajo y los de instancia voluntaria.\r\ng) Intervenir en los conflictos colectivos de trabajo que se susciten en establecimientos y empresas privadas, empresas del estado provincial que presten servicios públicos, servicios de interés público que desarrollen actividades industriales o comerciales, excepto cuando el conflicto exceda los límites de la Provincia, afecte la seguridad o el orden público nacional o él arden económico social de la Nación, los transportes o las comunicaciones interprovinciales, en que deberá abocarse en forma conjunta con el organismo nacional competente para entender en la materia.\r\nh) Intervenir en conflictos individuales o colectivos, ejercer el control, inspección y vigilancia de empresas contratistas que desarrollen tareas en el ámbito de la Provincia, tengan o no domicilio o residencia efectiva dentro de la misma.\r\nj) Promover la capacitación y formación profesional de los trabajadores.\r\nk) Intervenir en la fijación y contralor de la política salarial a implementarse en el ámbito de la Provincia.\r\nll) Aplicar sanciones por la inobservancia de las disposiciones que regulen el trabajo en todas sus formas y por el incumplimiento de los actos y/o resoluciones que dicte.\r\nm) Controlar el trabajo a domicilio, el de mujeres y menores y el servicio doméstico.\r\nn) Controlar y mantener asesoría jurídica para las cuestiones vinculadas con el trabajo, pudiendo establecerse convenios con otros organismos provinciales o nacionales.\r\no) Fomentar y coordinar junto con las asociaciones sindicales, la realización de obras asistenciales y culturales, estimulando planes de viviendas, creación de cooperativas, instalación de mutualidades, en coordinación con Ministerios o Secretarías competentes de la Provincia, o de la Nación y toda actividad de promoción social de los trabajadores.\r\np) Elaborar planes tendientes a concretar una política de pleno empleo y lograr que se eleve el nivel de vida de los trabajadores.\r\nq) Organizar la migración interna o interprovincial de mano de obra, coordinando esta actividad con servicios de empleo nacionales y provinciales, elaborando planes de asistencia y promoción para los trabajadores estacionales.\r\nr) Desarrollar toda actividad relacionada o conexa con la materia laboral.', 2015, '0362 444-8019', 'subsectrabchaco@gmail.com', 'https://www.facebook.com/Subsecretaria-de-Trabajo-de-la-Provincia-del-Chaco-1630427760554236/', '0362 444 6452', 'SEC.EMPLEOYTRABAJO@CHACO.GOV.AR', NULL, 'o362 4 332384', 'subsectrabchaco@gmail.com', NULL, 'organizacion_publica', 1, NULL, 1, '2016-05-26 09:00:57', '2016-07-19 10:08:21', 'no aceptado'),
