(27, 'Radio Master Fm 89.9', 'González', 'Isabel Clara', 'Titular', 'Ferrari', 'Carlos Alberto', 'Director', 'Emisión de frecuencia modulada en el canal de aire 89.9 mhz y por la web en www.radiomasterfm.com', 2006, '362-4335865', 'gerencia@radiomasterfm.com', 'http://www.radiomasterfm.com', '362-4450223', 'gerencia@radiomasterfm.com', NULL, '362-4335865', 'Ferraricarlos10@yahoo.com.ar', NULL, 'organizacion_privada', 2, NULL, 1, '2017-04-06 15:27:01', '2017-07-07 08:47:11', 'no aceptado'),
(30, 'Servicio de Oftalmología - Hospital Dr. Julio C. Perrando', 'Brollo', 'Verónica Ines', 'Jefa del Servicio', 'Domínguez', 'Lorena Karina', 'Coordinación Gral. de Planificación y Control  de Gestión', 'El Servicio de Oftalmología del Hospital Dr. Julio C. Perrando, es el único servicio con la especialidad en establacimientos Públicos, en la Provincia del Chaco, que brinda consultas ambulatorias como asi también prácticas de alta complejidad y cirugías. \r\nY cubre la atención de pacientes de 0 a 100 años, ya que presta servicio tanto a adultos como niños, recibe derivaciones de provincias y países limitrofes. \r\nCuenta además con regimen de capacitación permanente de profesionales (Residencia Médica de Oftalmología).', 1997, '0362-4425050 Interno 1806', 'serviciooftalmologiahperrando@gmail.com', NULL, '362-4548996', 'veronica_brollo@hotmail.com', NULL, '362-4816318', 'lore_poli@hotmail.com', NULL, 'organizacion_publica', 2, NULL, 1, '2017-04-24 12:19:11', '2017-07-10 09:53:18', 'activo'),
(31, 'Ecom Chaco SA', 'Flashka', 'Leandro Adolfo', 'Presidente', 'Gómez Ceniquel', 'Ethel Tamara', 'Responsable de Calidad', 'Empresa dedicada al estudio, análisis y desarrollo de nuevas tecnologías y sus aplicación en la administración pública y privada. Ellos comprende el desarrollo de productos, procesos y servicios en informática, comunicaciones, electrónica y productos de alta tecnología; brindando así soluciones integrales, garantizando sustentabilidad y calidad de servicio.\r\nLa infraestructura de comunicaciones de Ecom es única en el país; llegando mediante fibra óptica y radioenlaces donde otras empresas no lo hacen.', 1977, '3624-419300', 'at.usuarios@ecomchaco.com.ar', 'http://www.ecomchaco.gob.ar', '3624-419300', 'presidencia@ecomchaco.com.ar', NULL, '3624-419300 int 3201', 'tgceniquel@ecomchaco.com.ar', NULL, 'organizacion_publica', 2, NULL, 1, '2017-05-02 09:12:10', '2017-07-10 09:52:55', 'activo'),
(32, 'CENTRO ÚNICO COORDINADOR DE ABLACION E IMPLANTE DEL CHACO-C.U.C.A.I. CHACO-', 'DELLERA', 'CHRISTIAN', 'DIRECTOR', 'DELLERA', 'CHRISTIAN', 'DIRECTOR', 'Ente dependendiente del Ministerio de Salud Pública  encargado de  coordinar en nuestra Provincia las distintas etapas del proceso de donación y trasplante (registro de voluntad, certificación de muerte cerebral, inscripciíón  en las distintas  listas de espera, comunicación y concientización de la práctica, etc.) con un trabajo articulado con el ente rector central nacional', NULL, '03624453535', 'cucai_chaco@yahoo.com.ar', NULL, '0362154511650', 'chdellera@yahoo.com.ar', NULL, '03624453535', 'chdellera@yahoo.com.ar', NULL, 'organizacion_publica', 2, NULL, 1, '2017-05-05 13:19:19', '2017-07-10 09:51:04', 'activo'),
